import './App.css';
import {Row, Col} from 'react-bootstrap';

import AreaChartView from './pages/ChartPages/AreaCustomize';

import BubbleChartView from './pages/ChartPages//BubbleCustomize';
import ChordLogic from './components/Chart_Components/Logic/ChordLogic';

import BarChartView from './pages/ChartPages//BarCustomize';
import ArcChartView from './pages/ChartPages//Arc_Customize';
import ChordChartView from './pages/ChartPages//Chord_Customize';


const App =() => {
  console.log(ChordLogic([['mars','venus',100],['venus','mars',25],['venus','earth',299],['earth','mars',200],['mars','jupiter',500],['jupiter','venus',200],['venus','mercury',100],['mercury','venus',50],['earth','jupiter',200],['jupiter','mercury',800],['venus','jupiter',100],['neptune','pluto',200],['pluto','mars',800],['satum','neptune',100],['satum','venus',130],['earth','pluto',200],['mercury','earth',300],['neptune','venus',200],['venus','neptune',300],['pluto','neptune',400]]));
  return (
    <div className="App">
     
      <br></br>
      <hr />   
      <ArcChartView/>
      <br></br>
      <hr />   
      <BarChartView/>
      <br></br>
      <hr />   
      <AreaChartView/> 
      <br></br>
      <hr />    
      <BubbleChartView/>
      
      <br></br>
      <hr />
      
      
    </div>
  );
}

export default App;
